def solve():
    s = "t7 t6 t12 t15 t8 t3 t12 t14 t8 t7 t12 t10 t6 t0 t11 t14 t4 t9 t1 t15 t4 t0 t14 t2 t16"

    def is_valid(grammar, string):
        """
        Checks if a given string is valid according to the given grammar.
        """
        stack = []
        for token in string:
            if token in grammar:
                stack.append(token)
            elif token in grammar.keys():
                if len(stack) > 0 and grammar[stack[-1]] == token:
                    stack.pop()
                else:
                    return False
            else:
                return False
        return len(stack) == 0

    if is_valid(s, s):
        print("Yes")
    else:
        print("No")

solve()
