def solve():
    s = "t7 t5 t7 t8 t7 t5 t12 t0 t3 t2 t10 t2 t12 t10 t13 t13 t2 t0 t12 t9 t7 t6 t1 t7 t2 t11 t6 t12"

    def is_valid(grammar, string):
        try:
            # Parse the grammar
            grammar_dict = parse_grammar(grammar)

            # Check if the string is present in the grammar
            if string in grammar_dict:
                return True
            else:
                return False
        except:
            return False

    def parse_grammar(grammar):
        grammar_dict = {}
        for rule in grammar:
            group = rule.leaves()
            if group:
                grammar_dict[rule] = group
        return grammar_dict

    grammar = parse_grammar(s)

    if is_valid(grammar, s):
        print("Yes")
    else:
        print("No")

